package com.yedam;

public class Variable2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for (int j = 1; j <= 9; j++) {
				
			for (int i = 2; i <= 6; i++) {
				
					System.out.printf("%d * %d = %d\t", j, i, j * i);
				}
				System.out.println();
			}
			
		}
	}

